import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header className="Header"/>
    </div>
  );
}

function Header(){

  return(
    <>
     <footer className="w3-bar w3-white w3-border-bottom w3-xlarge">
     <a href={"#"} className="w3-bar-item w3-button w3-text-red w3-hover-red"><b><i className={"fa fa-th-list w3-margin-right"}></i>GenoRec</b></a>
     <a href="#" className="w3-bar-item w3-button w3-right w3-hover-red w3-text-grey">Tutorial</a>
    </footer>
    </>
  )
}

function Footer(){
  return (
  <>
  <div className="w3-container w3-center w3-opacity w3-margin-bottom">
  <h5>Find Us On</h5>
 </div>
  </>
  )
}

export default App;
